    def reset(self):
            for i in range(len(table)):
                    for j in range(len(table[0])):
                            if mark[i][j] == 0:
                                    table[i][j] = 0
            self.set_button_text()
            self.set_all_color()
            self.lineEdit.hide()
            self.enter.hide()
            self.tcr.hide()
    def _enter(self):
        txt =  self.lineEdit.text()

        if  txt == '' or txt == '0':
                table[self.current_row][self.current_collumn] = 0
                self.set_button_text()
                self.lineEdit.hide()
                self.enter.hide()

        else:
                if self.number_validation(txt) == False:
                        self.lineEdit.hide()
                        self.enter.hide()

                else:
                        nm = int(txt)
                        if valid(table, nm, self.current_row, self.current_collumn):
                                table[self.current_row][self.current_collumn] = nm
                                self.set_button_text()
                        if self.check_solve():
                                self.label_2.setPixmap(QtGui.QPixmap("img/Congrate.png"))
                                time.sleep(0.1)
                        self.lineEdit.hide()
                        self.enter.hide()
    def _done(self):
        self.mark_table_update()
        self.set_all_color()
        self.tcr.hide()
        self.pushButton.hide()
        self.cot.show()
        self.re.show()
        self.stt.show()

