    def solve_the_table(self):
            self.reset()
            if self.solve():
                    self.tcr.show()
                    self.tcr.setText("Solved....!!")
                    self.set_button_text()
            else:
                    self.tcr.show()
                    self.tcr.setText("Unsolvable")
                    self.set_button_text()
            self.lineEdit.hide()
            self.enter.hide()
    def solve(self):
            find = find_empty(table)
            if  find == None:
                    return True
            else:
                    current_ro, current_collum = find

            for i in range(1, 10):
                    if valid(table, i, current_ro, current_collum):
                            table[current_ro][current_collum] = i
                            self.set_button_text()
                            if self.solve():
                                    return True
                            table[current_ro][current_collum] = 0
                            self.set_button_text()
                            #time.sleep(0.2)
            return False

    def check_solve(self):
            for i in range(len(table)):
                    for j in range(len(table[0])):
                            if table[i][j]==0:
                                    return False
            return True
